verse: MAT.015.021
translations:
  kpx-kpx: Iesuu kateai louito matama ke halei tiale vata moleve velemanu. Vata kemo
    o baluga abuita Taea isi Saidoni keau ua. Iale Iesuu tiale o kebia vavae ua.
  okv-H: Eto Iesu na degi avo toto da Tyre te da Sidon te mihia amita enda ta pahunu
  tbo-tbo: Mi Isalaela hai tupo Yesu i nehaleya po i nae Taya ma Saidoni tupohihi
    uyahihi.
  mal-C: യേശു ആ സ്ഥലംവിട്ടു സോർ, സീദോൻ എന്നീ സ്ഥലങ്ങളിലൂടെ സഞ്ചരിക്കുകയായിരുന്നു.
  grc-SR: Καὶ ἐξελθὼν ἐκεῖθεν ὁ Ἰησοῦς ἀνεχώρησεν εἰς τὰ μέρη Τύρου καὶ Σιδῶνος.
  bgc-bgc: यीशु ओड़ै तै लिकड़कै, सूर अर सैदा के परदेसां कान्ही चल्या गया।
  khz-khz: Iesu na vokapu eraokwaniato, elakato eagoto pene ago Taia e Sidona kavara
    tanorai ekwarato.
  deu-TKW: Und Jesus gieng weg von dort und zog sich zurück in die Gegend von Tyrus
    und Sidon.
  zsr-NT: Niꞌr buzë́ꞌë niꞌ Jesús, gyijëꞌ lu xyu yödz Tiro len yödz Sidón.
  lin-lin: Yesu alongwaki wana mpe akendeki na etuka ya Tiri mpe ya Sidoni.
  hns-NT: Tab Jiesoe hoewa se tjal gail aur Tieras aur Siedon sahar ke aas-paas gail.
  noa-E: Maigmua igbaadeeu jũrr phöbör numí Tiro Sidón dʉ̈i nʉmʉg petaawai maarjã
    i dʉ̈i wëtjim.
  eng-EMTV: And going out from there, Jesus withdrew into the region of Tyre and Sidon.
  mib-NT: Te ni quenda Jesús yūcuan cuáhān yā región Tiro jiín Sidón.
  lif-NT2: हे़क्‍क्‍याङ् ये़सुःन् गालिललाम् इस्राइल लाःक्‍कात्‍पा तायर नु सिदोन ये़क्‌यक्
    खिरिबा थुम्‍हाॽओ पे॥
  xnj-xnj: Yesu awukili pandu penapo akahamba kutama kumuji wa Tilo na Sidoni.
  mmx-mmx: Iesu ga on basinge mo lemenemen la gat pas uto at lengkot saparap Taia
    la Sidon.
  cbr-NT: Anuax cuanx ca Jesús anua Tiro cacë ëma 'imainun Sidón cacë ëma 'icë a menu
    bëbacëxa.
  tee-NT: Pus ju acsnich ju Jesús taxtucha ju anch. Alh ju xalacat'un junta ix'alin
    ju lak'achak'anixni Tiro chai Sidón.
  eng-LSV: And Jesus having come forth from there, withdrew to the parts of Tyre and
    Sidon,
  cak-NT: Y ri Jesús junan quiq'uin ru-discípulos xel-e chiri', y xbe c'a pa jun lugar
    chiquinakaj ri tenemit quibinan Tiro Y Sidón.
  pah-NT: Aerẽ Jesus'g̃a hoi pea hugwi ogwovo. Cidades koty Tiro koty Sidom koty g̃a
    hoi ogwovo yhya rembeyvyra rupi.
  sja-NT: Mamãik'aapa Jesús wãji Tiro p'uuru mãik'aapa Sidón p'uuru k'ait'a bɨmaa.
  xed-xed: Tahula tsa ka sliʼafta Yesu ma tsa vli ya ka laghwi ta haɗika Tir nda ya
    nda ta haɗika Siduŋ.
  mks-NT: Tá na̱ndihi já na̱quee Jesús cua̱ha̱n chí ñundáhyi̱ cuéntá Tiro xi̱hi̱n
    cuéntá Sidón cán.
  gfk-S: Io, Jisas ga hana leh mekaia ma iga hana tano katano ta ira iruo taman, Tair
    ma ne Saidon.
  bmu-bmu: Jisösnöŋ Genesaret gölme mosöta siti qetŋiri Taiö aka Saidon mietkö distrik
    qetŋi Fonisia miaŋgö uruŋe anök.
  dgz-dgz: Iesu at ame ae ve pa Taya ge pa Saidon arigewa aen.
  eng-GNV: And Iesus went thence, and departed into the coastes of Tyrus and Sidon.
  zaa-NT: Beria Jesús nía nna huíe para región qui' ca yetsi Tiro nna Sidón nna.
  eng-WEBSTER: Then Jesus went thence, and departed into the territories of Tyre and
    Sidon.
  guh-guh: Jesús baja Genesaret nacuavecua pona. Naropota itsanacuayabelia, itsabelia
    eca anijatomarabeje, Tiro tomarabeje Sidón tomarabeje. Jesús baja pata bajarapanacuayabelia.
  bon-bon: Yeesu pui cewe ne sebmalige, ädige Turo piiyepu Sidona gawe cabu me.
  nhw-BL: Teipa Jesús quisqui nepa huan yajqui ipan nopa tlali nechca altepeme Tiro
    huan Sidón.
  swh-ONEN: Yesu aliondoka mahali pale, akaenda sehemu za Tiro na Sidoni.
  wbi-wbi: Pambele uYesu akavuuka pala, akaluta imbale isa likaaja ilya Tiilo ni lya
    Sidoni.
  bba-bba: Yen biru Yesu doonɑ min di u dɑ Tiri kɑ Sidonin berɑ ɡiɑ.
  eng-KJVCPB: Then Jesus went thence, and departed into the coasts of Tyre and Sidon.
  kgk-NT: Upe-gwi osẽ oho-vy Hesu. Okanhy oho-vy outro yvy-koty osẽ oho. Tiro tetã
    jerekwe-rupi, Sidom tetã jerekwe-rupi oho ave.
  waj-waj: Yisuuva itaa kua kiaa kioo ii yoosinna ivaa pikioo vioo yoosinna taaravaitana
    nnutuuvaitana Turu Sitoona vainima vau yoosinnaivaki viravai.
  cpy-cpy: Ikanta rawijanaki Jesús, jataki janta Mapiniki eejatzi Shimaaki.
  ekk-PKP: Jeesus lahkus ja läks Tüürose ja Siidoni aladele.
  mpx-mpx: Yeisu panuwa o i eguluwai, i nok i na Taya ge Saidoni wali labi elana.
  wbp-wbp: Ngula-jangka, Jijaji yanu yinya-ngurlu ngurrara-kari-kirra kujalpa-pala
    karrija kirri-jarra yirdi-jarraju Taya manu Jirdana.
  luo-luo: Ka noa kanyo, Yesu nodhi nyaka e gwengʼ mar Turo gi Sidon.
  nhe-NT: Teipa Jesús quisqui nepa huan yajqui ipan nopa tlali nechca altepetini Tiro
    huan Sidón.
  aii-aii: ܘܦܠܝܼܛ ܠܹܗ ܡ̣ܢ ܬܵܡܵܐ ܝܼܫܘܿܥ ܘܐܬܹ‌ܐ ܠܹܗ ܠܬܚܘܼܡܵܐ ܕܨܘܿܪ ܘܨܲܝܕܘܿܢ.
  esk-NT: Jesus aullaġniqsuq tavrakŋa nunaŋanun Tyre-m suli Sidon-ŋum.
  msb-msb: Naghali didto si Jesus kag nagpakadto sa lugar na halapit sa mga lungsod
    san Tiro kag Sidon.
  cpa-NT: Jøng² ca¹u¹hái¹ Jesús ja³jøng². Ca¹ŋó¹dsa juu¹² huø¹ cøg¹² jøa³juøi² Tiro
    quianh¹³ jøa³juøi² Sidón.
  dso-dso: ଜିସୁ ସେ ଜାଗା ଚାଡିକରି ସର ଆରି ସିଦନର୍‌ ସଅରେ ଗାଲା ।
  meu-meu: Iesu ese una gabu e rakatania, Turo bona Sidono kahadia ela.
  yva-NT: Yesus puje munijo we raora umba poroto no munijo Tirus muno Sidon.
  dgc-dgc: Nadid, hinumektat sa ti Jesus a inumange ta dumanég a se na Tiro sakay
    ta Sidon.
  zpm-NT: Ga briee Jesús, güey me haxta nëz Tiro ni nëz Sidón.
  hix-NT: Xenesarye yamtar hoye toy hatà, Txesusu. Toy hatà, Txeru màtkoso, Seknon
    màtkoso rma. Xuknewyanahnà komo yowto rma àro ha, Txeru, Seknon xarha.
  sim-sim: Ushihi Jisas yanga oson or halaha yanga Tair nga Saidon nga orok ormu ira.
  npi-ULB: त्यसपछि येशू त्यहाँबाट जानुभयो र टुरोस र सीदोन सहरहरूका क्षेत्रहरूतर्फ
    लाग्‍नुभयो ।
  cgc-cgc: Galin Jesus i ta Genesaret daw giling ta lugar na dani ta mga banwa na
    Tiro daw Sidon.
  tim-tim: Yesu kepia are hepunmâ kepia lâuwâ kotyetŋe Tiro akto Sidoŋ aregen ariep.
  yor-yor: Jesu sì ti ibẹ̀ kúrò lọ sí Tire àti Sidoni.
  wos-wos: Wun hundi wataka dé Jisas déka du wali wungi di wun getéfa yatakataka di
    nak hafwaré yi. Tair Saidonéna hafwaré di yi.
  emp-NTPO: Jesura mamaʌba Tiro druad̶e idjab̶a Sidoʌ̃ druad̶e pʌrrʌa wãsia.
  eng-F35: Going out from there Jesus withdrew into the region of Tyre and Sidon.
  ind-ind: Kemudian Yesus bersama kami murid-murid-Nya meninggalkan tempat itu dan
    pergi ke daerah sekitar Tirus dan Sidon.
  pes-OPCB: آنگاه عیسی ایالت جلیل را ترک گفته، به نواحی صور و صیدون رفت.
  mpt-mpt: Yesus esa eka e okok aleyemin naka isa i bib olo deiboniba moniba betan
    mak ye onsiobe. Betano yo bibo asube. O niniino Taia bib osa Saidon bib osa otabe.
  bla-bla: Jesus itŭmĭstŭpa'atomaie, ki Tyre ki Sidon ĭstssoots'ĭsts itsitap'po.
  ssx-ssx: Yesuma꞉ koto alena꞉ mina꞉pa꞉lao Taiya Saidoni daoni yaapo nane peekeme.
  mkl-mkl: Si ɑnyii nŋu, Jesu í nɛ hɑi bɛ í bɔ ikpɑ Tii do Sidɔ̃ɔ.
  gaq-gaq: ଜିସୁ ଆତେନ୍‌ ଜାଗା ଆନ୍ତାର୍ଚେ ସୋର ଆରି ସୀଦୋନ ଇନି ୱେଗେ ।
  gof-RNT: Hessafe guye, Yesuusi yaappe keyidi Xiroosanne Sidoona katamati de7iya
    biittaa bis.
  unx-unx: ୟୀଶୁ ଏନ୍‌ ଠାୟାଦ୍‌ ବାଗିକେଦ୍‌ତେ ସୋର୍‌ ଆଡଃ ସିଦୋନ୍‌ ପାର୍‌ଗାନ୍‌ରେୟାଃ ସାହାର୍‌ତେ
    ସେନଃୟାନା ।
  gah-gah: Loko loake, Izesuki makó vunike mikasi ahuloko Tulo numutoka itó Sitona
    numutoka apá agilikaloka voko nouko nene,
  lcm-lcm: Na Iesu kala papelek suai ani rina ang na kala pasal ane palpal i Turo
    na Sidon.
  aer-aer: Yanhe-ngentyele Jesus alheke apmere yanhe iwerle-alhemele akweke ware anetyeke
    apmere Tyre uthene Sidon uthene itwele.
  qvc-NT: Chaymandaqam Jisusqa chay kaykashqanmanda rirqanna (Isrrayilpa ladumbi kaq
    nasyunman.) Chay nasyumba Tiru llaqtamba, Sidun llaqtamba sirkanman ch'ayarqan.
  tgl-ULB: Pagkatapos, umalis si Jesus mula roon at pumunta patungo sa mga rehiyon
    sa lungsod ng Tiro at Sidon.
  cbs-NT: Janua Jesús kainkaini mae dabe Tiro inun Sidón dapi kaken
  xtm-NTPP: Sani te kua'an Jesús ma ichi ñuu nani Tiro ma ji'in Sidón ma.
  nnq-nnq: Yesu ngaboka paali penia ngajenda kutama kukilambo chu Kutilo na Kusidoni.
  bao-NT: Jiro, too ca niiricarã, Tiro, Sidón ca wãme cʉtiri yepa pee jãa waacoawʉ.
  san-ORI: ଅନନ୍ତରଂ ଯୀଶୁସ୍ତସ୍ମାତ୍ ସ୍ଥାନାତ୍ ପ୍ରସ୍ଥାଯ ସୋରସୀଦୋନ୍ନଗରଯୋଃ ସୀମାମୁପତସ୍ୟୌ|
  huv-NT: Condom Teat Jesús taw quiaj, tamb andüy tiül iüt ocueaj cambaj Tiro maquiiüb
    Sidón.
  otn-NT: Mi̱ bømp'ʉ mi̱ 'bʉhra̱ Jesús, i̱ map'ʉ ja n'na ra̱ häi ja ra̱ hni̱ni̱ Tiro
    conna̱ hni̱ni̱ Sidón.
  nop-nop: Kaŋ Jesu adi kwet u bikabuŋa kwet wapum Taiya dut Saidon yokwet ikumukneŋ
    uguk.
  obo-NT: Na, id tanan si Disas dutun woy mid undiyon to lugaa no sakup to mgo bonuwa
    to Tiro woy Sidon.
  cak-ENT: Y ri Jesús ye rachibilan ri rachibila' xel c'a e chiri', y xbe c'a cala'
    pa jun lugar ri nakaj ncanaj cheque ri tinamit quibini'an Tiro y Sidón.
  lif-NT: ᤜᤧᤰᤁᤩᤠᤱ ᤕᤧᤛᤢ᤺ᤴ ᤃᤠᤗᤡᤗᤗᤠᤶ ᤀᤡᤛᤪᤠᤀᤡᤗ ᤗᤠ᤺ᤰᤁᤠᤳᤐᤠ ᤋᤠᤕᤖ ᤏᤢ ᤛᤡᤍᤥᤏ ᤕᤧᤰᤕᤰ ᤂᤡᤖᤡᤒᤠ ᤌᤢᤶᤜᤠ᤹ᤀᤥ
    ᤐᤣ॥
  mie-NT: De nī nquee Jesús ñúcuán cuāhān yā región Tiro jíín Sidón.
  san-TIB: ཨནནྟརཾ ཡཱིཤུསྟསྨཱཏ྄ སྠཱནཱཏ྄ པྲསྠཱཡ སོརསཱིདོནྣགརཡོཿ སཱིམཱམུཔཏསྱཽ།
  qve-NT: Jesusqa Genesaret llaqtamanta lloqsispanmi, Tiro sutiyoq llaqtapa, hinallataq
    Sidón sutiyoq llaqtapa cercanman riran.
  pao-NT: Soo Te Pabe'e Jesus ka numme tu nakatzimodu-no yise oona wawa'a tubewabe-witoo
    Tyre noko Sidon-witoo mease o petuga.
  cbu-NT: Isussha iyapat Galileyush káyashinuni arap nllitaritap tputs watsapun naataranganiya.
    Nda Utaáp tsapu. Tírshuch tputs mishat Sitónshuchtam tputs watsapunu.
  usa-usa: mi-kánááráqá Îtuma maami-márúqá yuwéna Tááya-marupakaraq Tááírana-marupakaraq
    uráiye.
  soy-soy: Yeesu uu limɛmɑ́ɑ́ kei yisi uu Tiiri nɛ Sitɔɔ sitẽ-mɛ̃ tɔ́mpɔ.
  hui-hui: Yasu ibu dindi ogoni wahalu dindi Taia tanohayagibi Saidono tanohayagibi
    pene.
  amf-amf: Yesus ogo raqira utayse Thiroosbee Sidoonabe peendar ki yivade.
  quc-NNT: Xel b'i ri Jesús chila', xe'k, xopan pa Fenicia chunaqaj ri tinimit Tiro,
    xuquje' ri tinimit Sidón.
  dob-dob: ꞌEnega Yesu sena nina ꞌipilisinena ga ꞌitauya Taiya be Saidoni senadiyao
    ꞌediya.
  wrs-wrs: Yesusva nominiva venamba, os gana Yutanindna meisnindna petharam, dom ten
    Tair kota eva Saiton kota elohvnam. Yesusva himba hevho wongavna hevna aonghal
    mahalnindmangas, numhowolalm. Doa mongo ungevlirini no kembellini pro Yesusindam,
    no ungevliriniva Kenan tindiriniongo. No ungevliriniva pronamba, dandwonam Yesusm
    omnana, mendekli, yimba Devit kuwultindirini lohv, kam wavra vovhoamno, wo kana
    mom sishona vro. Nemet doara heva tihsongo nonglanamba, wo noinda himba uvavulmungil
    dihelv.
  mca-mca: Ma' qa ha' Jesús qa ikik'ui iye ha' i'ntaxi' qa yamii hakha' sehe' te'weyij
    he' witsetits Tiro qa ha' Sidón.
  tzo-TZC: Ti Jesuse ilocꞌ batel. Tey ibat ti bu oy chib jteclume ti jaꞌ ti Tiroe
    schiꞌuc ti Sidone.
  mya-mya: သ​ခင်​ယေ​ရှု​သည်​ထို​အ​ရပ်​မှ​ထွက်​ခွာ​တော်​မူ ၍ တု​ရု​နှင့်​ဇိ​ဒုန်​နယ်​များ​သို့​ကြွ​တော်​မူ​၏။-
  gng-NT: '*Yesu siere'' niʼsaan, nɛ ki bure'' Tir nin Sidɔn ya tinfɛnm bó.'
  cbi-NTPO: Jesús junu malu' miji', Tiro pebulu bain, naa Sidón pebulu bain chunu
    tusha jimi.
  ikk-NT: Jizọsị nọ gha ebẹhụ pụ, si ẹgbẹrẹ Taya-lẹ-Sidọnụ.
  leu-leu: Na Yesus a taꞌulan a bina aave e falet xe pe la ro bina Tair e Saidan.
  maz-NT: Nuc'ua o mbedye nu e Jesús, o ma a ma cja c'o jñiñi a Tiro 'ñe a Sidón.
  bod-N: སྐྱབས་མགོན་ཡེ་ཤུ་ཡུལ་དེ་དང་ཁ་བྲལ་ནས་ཐཱར་དང་ཚི་ཏུན་གྱི་མངའ་ཁོངས་སུ་ཕེབས་པ༌ན།
  tca-NT: Rü yexguma yéma inaxũãchigu ga Ngechuchu, rü Tiruane rü Chidã́ũãneãrü ĩãnegüwa
    naxũ.
  zpl-NT: Chenu uchiuꞌu Jesuse lu iliu Genesaret nzanu enza lu eyeche Tiro cuna lu
    eyeche Sidón.
  mbc-NT: Mîrîrî pata yapai Jesus ese'ma'tî'pî. Attî'pî Tiro pata poro aminke pra
    cidade pî'. Moropai Sidom pata poro attî'pî.
  ndg-ndg: Yesu ngaboka pandu palo kayenda kutalu yenda upande wa Tiro na Sidoni.
  wsk-wsk: Asele Jesus wonong umu beteram ale Tyre se Sidon sor koma namara mu te
    namaram.
  toj-NT: Ja Jesusi ti el ja tihui. Ti huaj ja ba lugar ba mojan ja chonab Tiro soc
    ja chonab Sidoni.
  tbc-tbc: Agog Jesus aben an ibiseig gob adi sad tan ate yaug, Taia iŋ Saidon da
    sad distrik lo itilianig itor se ya.
  sna-sna: Jesu akabvapo akaenda kudunhu reTire neSidhoni.
  smk-NT: Linmakwan saraynadtaw si Jesus tan nako sara sa sayay lugar nin adani sa
    syudad nin Tiro tan Sidon.
  grc-TCGNT: Καὶ ἐξελθὼν ἐκεῖθεν ὁ Ἰησοῦς ἀνεχώρησεν εἰς τὰ μέρη Τύρου καὶ Σιδῶνος.
  gof-WFTW: Hessafe guye, Yesuusi yaappe keyidi Xiiroosanne Sidoona katamati de7iya
    biittaa bis.
  spa-BLM: Jesús salió de allí y se retiró a la región de Tiro y Sidón.
  kyz-NT: A'ere Jejui 'ga ore rerawau pe awi nũ. Tiro 'jawa pyri ore oi, Sidoma 'jawa
    pyri 'jau.
  dao-dao: Jesuh acun üngka naw cit lü Turah ja Sidon mlüh peisua citki.
  cya-cya: Xacan' mdo'o Jesús nguiaa ñi, lo' mdiyaa ñi loo yuu se'en lyi'ya loo quichen
    Tiro lo'o Sidón.
  wrk-wrk: Barlbayi Jisus nanamunanyi yajinanyi. Barlba nyuli yingkayurri yajiyurri.
    Barlba nyuli langki, bundu nanankuyanyina barrawuyabarrawuyana, niji Daya marda
    Sayidun.
  nii-nii: Jiisas konu ełe si kindpi, pupu Taiya kin Sairon konu ełe mandi tor pum.
  ign-NT: Tacahe, tiámaha­vi­varepa ema Jesús te apana avasareana táunavahi eta departamento
    Siria, návasa ena apaecha­ji­ri­ruvana.
  dik-NT: Ku jɔl Jethu jäl ku ler wun dɛ̈t tɛ̈thiääk kek Tire ku Thidon.
  cac-cac: Ix lajvi chi', ix b'atxi Jesús. Ix c'och d'a yol yic Tiro yed' d'a Sidón.
  tzj-E: C'jara' ja' Jesús xel ela chpam lwar, xba chic chpam jun lwar abar c'o wa'
    c-e' tnamet, jun rbin-an Tiro y jun chic Sidón rubi'.
  bpx-bpx: ईसु तां गेथो नीकळीन सुर अने सेदा परगणा भणी चाल पड़्‌यो।
  san-BUR: အနန္တရံ ယီၑုသ္တသ္မာတ် သ္ထာနာတ် ပြသ္ထာယ သောရသီဒေါန္နဂရယေား သီမာမုပတသျော်၊
  yaa-NT: Askata Jesús aõxõ tãpimisfo fe kani nã pexe rasi Tiro fe Sidón chaimashta
    ano.
  cab-NT: Ába láfuridun Jesúsu ñígiñe, ába lídin lídoun buri fulásu geyégua láu fulásu
    le Tíro lúma Sidón.
  clu-clu: Nagalin si Jesus sa logar nga dato kag nagayan tana sa mga logar nga marapit
