    panga yereng Taya keya Sairong mei Yuda onowili yolu piyaugi ngabelakpokko kambela.
  gux-G: Yesu bo ñani lan kani ki gedi Tiri yeni Sidɔni dogi nni.
  cnl-NT: '''E³ quie''²³ ca²³bǿn³ Jesús. Ŋóo² la²³ca̱a̱n³ je² røøn³ juɨɨ³ Tiro quia̱''²
    juɨɨ³ Sidón.'
  zar-NT: Níʼirö buzë́ʼë Jesús niʼ, en guyéajëʼ lu xiyú yödzö Tiro, en yödzö Sidón.
  kde-kde: Bahi Yesu nkuuka pachinu anepo, nkuhwena kuchilambo chivêle pepi na dimanga
    dya ku Tilo na ku Sidoni.
  ata-ata: Xe Iesu muavuti la musuku no tuala e muneꞌe muxolu no anu ne, sou mulai
    no xalee lia tila ne Taia xe Saidoni.
  qvw-NT: Chaypïtam Jesus licula Tirop, Sidonpa malcancunaman.
  nfa-nfa: Èle èèna ka, Yesus tèke eele era neꞌe, kako laꞌe asa kota Tirus dènge kota
    Sidon.
  tnp-tnp: Kəni Iesu təmiet ikɨn əha, kəni muvən ikɨn iətəm taun keiu əha, Taea mɨne
    Saedon kətuəməhli ikɨn.
  urd-urd: फिर ईसा वहाँ से निकल कर सूर और सैदा के इलाक़े को रवाना हुआ।
  hot-hot: Yisu hatak loŋ êŋ ma hi hamô habobo Taia lo Saidon.
  mqj-NT: Mangkai too, mengkalaomi Puang Yesus umpellei angngenan iatoo lu lako lembangna
    Tirus sola Sidon.
  rus-SYN: И, выйдя оттуда, Иисус удалился в страны Тирские и Сидонские.
  mbh-mbh: Lamako Jisas i lospot nge wop aken, ma i es a epee ako a rem a Tair na
    Saidon.
  bdd-bdd: Ma Yesu tupwaina ꞌiꞌebesineya ta ꞌitauya Taiya ma Saidoni tupwaidi ꞌoidiya.
  cbt-NTPO: Ina quëran Cotia parti quëran pipirahuaton, Tiro, Siton, inapita parti
    pa'nin.
  srn-NT: Yesus kmoto drape, dan A go ini a kontren fu den foto Tirus nanga Sidon.
  cta-NT: Loꞌo liꞌ nduꞌu Jesús ndyaa nde loyuu su cuentya quichi̱ Tiro loꞌo loyuu
    su cuentya quichi̱ Sidón; loꞌo nu nguꞌ nu ndyaca tsaꞌa̱ jiꞌi̱ ndyaa nguꞌ loꞌo.
  bqc-SIM: Ɔ̃ Yesu bↄ̀ we à gɛ̀ Tii ń Sidↄ̃o bùsuu.
  tcz-CHONGTHU: Chujouvin Yeshuan Galilee chu adalhan chuin Tyre le Sidon gamkai sahlama
    agache toutai.
  mar-mar: नंतर येशू तेथून निघून सोर व सिदोनाच्या भागात गेला.
  snp-snp: Ena Yesu ya ebawa fulito monimo Taiyaki ido Saidoniki eba afulaleka wiye.
  isl-isl: Jesús hélt síðan burt og fór norður til Týrusar og Sídonar, en þangað voru
    um 80 kílómetrar.
  spy-NT: Yu kang'eetee ꞉Yēēsu yooto ākoo rubiikyii, kuwo ākoy kōōrēētaab kiriinkēētaab
    Tiirō āk Sitōōn.
  xnn-xnn: Nakwas pay dadi dat komaan da Jesus et omeyda isnan sakop nan ili ay Tiro
    ya Sidon.
  mwe-mwe: A Yeshu gubhajabhwile pepala gubhapite tama mmbali ja ku Tilo na ku Shidoni.
  tte-tte: Yeisu yanuwane ilogabaeni, ilau Taiya yo Saidoni dedeili mena.
  tcs-tcs: Apta prom de, Zizas i bin tekop go po nowessaid go po da eria blo demtu
    taun Taira ane Sidon.
  hlt-THB: Ce hyn awhkawng Jesu taw Tura ingkaw Sidon khaw khqang ce cet hy.
  soq-soq: Tane Iesu Israel tawowa ene Taire ita Saidon bolau kerakera bedeuwointa
    alen.
  qub-qub: Chaypita Jesús aywacuran Sidón y Tiro marcacuna cajman.
  att-att: Á nánaw laguk si Apu Kesu tán nga lugár, nga minay ta lugár nayù ira ili
    na Tiro ánna Sidon.
  bki-bki: Naruei Yesu juvan vio nei, ana naio batove ea bulukomeli juo na vio Taia
    bija Saiton.
  bqp-bqp: Akũ Yesu bò gwe, à gɛ̀ɛ Taya kũ Sidↄ̃o bùsun.
  mcp-mcp: Yésus músə wú na kʉ́l nɨɨ́d. A músə kə kɔ́ɔ́mb shí á Tir nə Sidon.
  hat-hat: Jezi kite kote l' te ye a, li ale nan zòn lavil Tir ak lavil Sidon.
  npl-NT: Ijkuakó Jesús okiski de ompa, iwa oyá kan tlalmeh de Tiro iwa Sidón.
  bgg-bgg: Isu ne ji pha ithua thoh marui ne Thaire nane Sidon pha rajan pha soh hà
    wuii dun.
  eng-TCENT: Then Jesus went away from there and withdrew to the district of Tyre
    and Sidon.
  eng-BSB: Leaving that place, Jesus withdrew to the district of Tyre and Sidon.
  cpu-NT: Ipoña ikenanake Jesús nampitsiki paitachari Tiro irojatzi Sidón-ki.
  san-ASM: অনন্তৰং যীশুস্তস্মাৎ স্থানাৎ প্ৰস্থায সোৰসীদোন্নগৰযোঃ সীমামুপতস্যৌ|
  tac-NT: '''Liko Esusi simile alé Tiro anilichi we''ká riógichi ''lige Sironi anilichi
    we''ká riógichi, napu ejperégame nile alué ralámuli tabilé israelita. (Alué ralámuli
    israelita napurigá o''kochí alarigá neraga etele alué ralámuli.)'
  eng-WEBPB: Jesus went out from there and withdrew into the region of Tyre and Sidon.
  gfk-H: Io, Iesu ga haan laah makaia ma ga haan tano hanua ta ira airua pisa na hala,
    Tair ma Saidon.
  viv-viv: Tu Yesu mena melalai-nadi gihegena ana tomuliya buye hina Taiya Saidoni
    adi fafali againe.
  yao-yao: Che Yesu ŵatyosile kweleko ni ŵajile ku chilambo cha ku Tilo ni ku Sidoni.
  tgp-tgp: Ale Iesu mo malue hin jara atu, mo vano na jara tavera matan Tyre enia
    Sidon.
  auc-NT: Mänïñömö quëwente wadæ godinque Itota Tido näni quëwëñömö Tidöö näni quëwëñömö
    eyequeï pongacäimpa.
  kbc-NT: Jesus naɡ̶a noditedicogi niɡ̶idi nipodigi, odaa jiɡ̶igo ica nipodigi anipegitege
    nigotadi Tiro aniaa Sidom.
  bmh-bmh: Yesus gue uzan go uteimai, emgasag tub Tair ban uzan mui Saidon ban uzan
    ula ebu beteun.
  ctu-BL: Jesús tsa' loq'ui ya'i. Tsa' majli ti' lumal Tiro yic'ot ti' lumal Sidón.
  meq-meq: Ma dəba eye na, Yesu a lətse abəra ma təv niye, a ye ka dala i Tir ada
    a Sidoŋ.
  noa-H: Maigmua higbaadeeu jũrr p'öbör numí Tiro Sidón dʌ̈i nʌmʌg petaawai maarjã
    hi dʌ̈i wëtjim.
  alp-NT: Eleki Yesuse Ikeu bei mere lori otoi rebe tehaike kota Tiruse kai Sidone.
  san-VEL: anantara.m yii"sustasmaat sthaanaat prasthaaya sorasiidonnagarayo.h siimaamupatasyau|
  kbq-kbq: Anantetira Jisasi'a ana kumara atreno, Tairine Saitoni kumate vigeno,
  kbh-kbh: Jesús chents̈ana, Tiro y Sidón luarëngoye tojtsanoñe.
  ron-LSB: Isus a ieșit de acolo și s-a retras în ținutul Tirului și al Sidonului.
  pon-pon: Iejuj ap kotila jan waja o, kotilan wein Tiruj o Jidon.
  nhe-BL: Teipa Jesús quisqui nepa huan yajqui ipan nopa tlali nechca altepetini Tiro
    huan Sidón.
  sps-sps: Jisas naus osing to na pan to aya sa naa fi en naa naa tana pan panan a
    fuan a ngats fan iny Taia ai Saidon.
  wnc-wnc: Siwan Jesuta uneta enake keu komdune kukut. Keu wakomune you gapmaya yuamayau
    umana Taiaat Saidonkat ngang yanikaing.
  nmw-S: Yeisu i seyok hiyebe yake, ge i lok i la Taya ge Saidon he wedi ganahao.
  bus-bus: Ben Yesu bↄ̀ gwe, à gàa Taya kↄ̃n Sidↄ̃o bùsun.
  gub-BL: Uhem Zezuz oho a'e wi a'e kury. Uhem oho Xir tawhu huwake kury. Uhem oho
    Xitom tawhu huwake no.
  imo-imo: Kano kinye Jisas kombu Genesaret tiye kolopa Juda imboma moloringi kombu
    Galili distrik tawendo kombu awili Tair kinye Saidon talo lerimu kombuna tukundo
    purumu.
  boj-boj: Onaqa Yesus a dena tigelosiqa walwelosiq Tair qure ti Saidon qure ti naŋgo
    sawaq gilej.
  eng-DRA: And Jesus went from thence, and retired into the coasts of Tyre and Sidon.
  knf-knf: Wi Yeŧu apënuŋ da aşë ya du ŋŧaak ŋi Tir na Ŧidoŋ
  san-KHM: អនន្តរំ យីឝុស្តស្មាត៑ ស្ថានាត៑ ប្រស្ថាយ សោរសីទោន្នគរយោះ សីមាមុបតស្យៅ។
  arn-NT: Fey Jesus tripatuy tiyechi mapu mew ñi amuael ta Tiro ka Sidon trokiñ mapu
    mew.
  zas-NT: Chi baza Jesús yagaj zëman niz Tiro në niz Sidón.
  ken-NT: Yesu afa yɛ atú Gálili nɛ bakoŋo bhi, bárɔk ndǔ atú ɛtɔk anɛ achi kɛkwɔt
    Táya nɛ Sídɔn.
